INSERT INTO `character_characters` VALUES ('1001', '榎本夏樹', 'えのもとなつき', '戸松遥', '161cm', '6月27日', '蟹座', 'O型', '桜丘高校３年生。美術部所属。<br>みんなから「なっちゃん」と呼ばれている。<br>優、春輝、蒼太とは幼馴染。<br>大きなおだんごヘアがトレードマーク。<br>優のことが好き。<br><br>【登場楽曲】<br>告白予行練習・病名恋ワズライ', '21001071', '1001002'); 
INSERT INTO `character_characters` VALUES ('1002', '瀬戸口優', 'せとぐちゆう', '神谷浩史', '178cm', '7月11日', '蟹座', 'AB型', '桜丘高校３年生。映画研究部所属。<br>夏樹、春輝、蒼太とは幼馴染。<br>面倒見がよく、妹の雛を大事にしている。<br>クラスの人気者で、女子からモテる。<br><br>【登場楽曲】<br>告白予行練習・テレカクシ思春期', '21002071', '1002002'); 
INSERT INTO `character_characters` VALUES ('1003', '早坂あかり', 'はやさかあかり', '阿澄佳奈', '158cm', '12月3日', '射手座', 'O型', '桜丘高校３年生。美術部部長。<br>夏樹や美桜とは友達。<br>絵が上手く、絵画コンクールでは何度も受賞している。<br>男子にモテるが、本人は恋愛に疎い。<br><br>【登場楽曲】<br>私が恋を知る日・僕が名前を呼ぶ日', '21003022', '1003002'); 
INSERT INTO `character_characters` VALUES ('1004', '望月蒼太', 'もちづきそうた', '梶裕貴', '165cm', '9月3日', '乙女座', 'B型', '桜丘高校３年生。通称「もちた」。<br>映画研究部では脚本の執筆を担当。<br>夏樹、優、春輝とは幼馴染。<br>あかりに片想いしている。<br><br>【登場楽曲】<br>ヤキモチの答え・僕が名前を呼ぶ日', '21004020', '1004002'); 
INSERT INTO `character_characters` VALUES ('1005', '合田美桜', 'あいだみおう', '豊崎愛生', '153cm', '3月20日', '魚座', 'A型', '桜丘高校３年生。美術部副部長。<br>夏樹やあかりとは友達。<br>絵を描くのが好きで、大人しい性格。<br>春輝へ想いを寄せているが、<br>伝えられないでいる。<br><br>【登場楽曲】<br>初恋の絵本・一分一秒君と僕の', '21005071', '1005002'); 
INSERT INTO `character_characters` VALUES ('1006', '芹沢春輝', 'せりざわはるき', '鈴村健一', '175cm', '4月5日', '牡羊座', 'A型', '桜丘高校３年生。<br>映画研究部に所属し、監督として活躍中。<br>夏樹、優、蒼太とは幼馴染。<br>１年生の頃から美桜が気になっている。<br>将来の夢は映画監督。<br><br>【登場楽曲】<br>初恋の絵本・一分一秒君と僕の', '21006070', '1006002'); 
INSERT INTO `character_characters` VALUES ('1007', '綾瀬恋雪', 'あやせこゆき', '代永翼', '163cm', '8月28日', '乙女座', 'A型', '桜丘高校３年生。園芸部部長。<br>目立たない存在だったが、「あること」を<br>きっかけにイメチェンをする。<br>雛の中学時代からの先輩で、片想いの相手。<br><br>【登場楽曲】<br>告白ライバル宣言・センパイ。', '21007022', '1007002'); 
INSERT INTO `character_characters` VALUES ('1008', '成海聖奈', 'なるみせな', '雨宮天', '160cm', '10月16日', '天秤座', 'B型', '桜丘高校３年生。<br>読者モデルの仕事をしており、人気者。<br>あかりとは仲が良く、一緒に通学している。<br>春輝、翠と同じクラス。<br><br>【登場楽曲】<br>可愛くなりたい・ワタシノテンシ', '21008073', '1008002'); 
INSERT INTO `character_characters` VALUES ('1009', '濱中翠', 'はまなかみどり', 'Gero', '169cm', '1月23日', '水瓶座', 'A型', '桜丘高校３年生。軽音楽部所属。<br>中学までは関西にいた。<br>春輝、聖奈と同じクラス。<br>毎朝、通学電車で顔を合わせる聖奈のことが<br>気になっている。<br><br>【登場楽曲】<br>金曜日のおはよう・日曜日の秘密', '21009020', '1009001'); 
INSERT INTO `character_characters` VALUES ('1010', '瀬戸口雛', 'せとぐちひな', '麻倉もも', '149cm', '8月8日', '獅子座', 'A型', '桜丘高校１年生。陸上部所属。<br>兄である優のことが大好き。<br>夏樹や虎太朗とは家が隣同士で、<br>家族ぐるみの付き合い。<br>中学生の頃から恋雪のことが気になっている。<br><br>【登場楽曲】<br>今好きになる。・センパイ。', '21010073', '1010002'); 
INSERT INTO `character_characters` VALUES ('1011', '榎本虎太朗', 'えのもとこたろう', '花江夏樹', '160cm', '11月29日', '射手座', 'O型', '桜丘高校１年生。サッカー部所属。<br>夏樹の弟。<br>幼馴染である雛に片想いをしているが、<br>なかなか素直な態度が取れない。<br><br>【登場楽曲】<br>大嫌いなはずだった。・今好きになる。-triangle story-', '21011070', '1011002'); 
INSERT INTO `character_characters` VALUES ('1012', '高見沢アリサ', 'たかみざわありさ', '東山奈央', '150cm', '2月3日', '水瓶座', 'B型', '桜丘高校１年生。<br>聖奈の大ファンで、トレードマークの<br>ツインテールは彼女の影響。<br>雛、虎太朗、シバケン、幸大とは同じ中学。<br>家は神社。<br><br>【登場楽曲】<br>ハートの主張・生意気ハニー-another story-', '21012072', '1012002'); 
INSERT INTO `character_characters` VALUES ('1013', '柴崎健', 'しばさきけん', '江口拓也', '167cm', '4月1日', '牡羊座', 'O型', '桜丘高校１年生。通称「シバケン」。<br>虎太朗や幸大とは中学から親しくしている。<br>恋愛をゲームと捉えている遊び人だが、<br>アリサとの出会いがきっかけで、<br>変化が起きていく。<br><br>【登場楽曲】<br>イジワルな出会い・生意気ハニー', '21013023', '1013002'); 
INSERT INTO `character_characters` VALUES ('1014', '山本幸大', 'やまもとこうだい', '松岡禎丞', '172cm', '11月7日', '蠍座', 'A型', '桜丘高校１年生。新聞部所属。<br>虎太朗、シバケンとは中学時代からの友達。<br>写真を撮ることと、本を読むことが好き。<br><br>【登場楽曲】<br>ハートの主張・大嫌いなはずだった。', '21014040', '1014002'); 
INSERT INTO `character_characters` VALUES ('1015', '涼海ひより', 'すずみひより', '水瀬いのり', '150cm', '3月31日', '牡羊座', 'O型', '桜丘高校新１年生。陸上部所属で雛の後輩。<br>上京したばかりで一人暮らしをしている。<br>LIP×LIPの愛蔵、勇次郎とはクラスメイト。<br>ひょんなことからアルバイトでも<br>LIP×LIPの２人と関わることに。<br><br>【登場楽曲】<br>ヒロイン育成計画・ヒロインたるもの！', '21015040', '1015001'); 
INSERT INTO `character_characters` VALUES ('1016', '染谷勇次郎', 'そめやゆうじろう', '内山昂輝', '161cm', '2月22日', '魚座', 'B型', '桜丘高校新１年生。ひよりと同じクラス。<br>アイドルユニット・LIP×LIPのメンバー。<br>特技は日本舞踊と三味線。<br>実は甘いものが好き。<br><br>【登場楽曲】<br>ロメオ・他のやつにいくなんてさ', '21016037', '1016001'); 
INSERT INTO `character_characters` VALUES ('1017', '柴崎愛蔵', 'しばさきあいぞう', '島﨑信長', '166cm', '2月22日', '魚座', 'A型', '桜丘高校新１年生。ひよりと同じクラス。<br>アイドルユニット・LIP×LIPのメンバー。<br>運動神経が抜群でダンスが得意。<br>実はシバケンの弟だが、仲が悪い。<br><br>【登場楽曲】<br>ノンファンタジー・YELLOW', '21017030', '1017001'); 
INSERT INTO `character_characters` VALUES ('1018', '成海萌奈', 'なるみもな', '夏川椎菜', '160cm', '4月24日', '牡牛座', 'AB型', '聖奈の３歳年下の妹。<br>高校生になってからはmonaという名前で<br>アイドルとしても活動している。<br>しかし、聖奈の妹であるということは<br>公表していない。<br><br>【登場楽曲】<br>私、アイドル宣言・ファンサ', '21018024', '1018001'); 
INSERT INTO `character_characters` VALUES ('1022', '明智咲', 'あけちさく', '緑川光', '183cm', '5月29日', '双子座', 'O型', '桜丘高校の教師。映画研究部の顧問。<br>担当教科は古典だが、チョークで服が<br>汚れないように白衣を着ている。<br>禁煙のため、ポケットに飴を常備している。<br>高校時代、春輝の兄・千秋とは親友だった。<br><br>【登場楽曲】<br>イノコリ先生', '21022039', '1022001'); 
INSERT INTO `character_characters` VALUES ('1023', '白雪風真', 'しらゆきふうま', '莉犬', '160cm', '12月20日', '射手座', 'A型', 'アイドルユニット・Dolceのメンバー。<br>実は男の娘。<br>とあることがきっかけで、<br>アイドルデビューを果たす。<br>趣味はメイクの研究とバスケ。<br><br>【登場楽曲】<br>ベビベビ・イロドレ', '21023023', '1023001'); 
INSERT INTO `character_characters` VALUES ('1024', '灰賀一騎', 'はいがかずき', '坂田明', '165cm', '7月7日', '蟹座', 'O型', 'アイドルユニット・Dolceのメンバー。<br>おっとりした性格で、風真とは幼馴染。<br>特技はふわふわのホットケーキを作ること。<br><br>【登場楽曲】<br>ベビベビ・イロドレ', '21024020', '1024001'); 
INSERT INTO `character_characters` VALUES ('1025', '塔上沙良', 'とうじょうさら', '浦田わたる', '170cm', '10月31日', '蠍座', 'AB型', 'アイドルユニット・Dolceのメンバー。<br>アイドルとしての才能はピカイチだが、<br>口が悪く、事あるごとにレッスンをサボる。<br>趣味はメイド喫茶に行くこと。<br><br>【登場楽曲】<br>ベビベビ・イロドレ', '21025023', '1025001'); 
INSERT INTO `character_characters` VALUES ('1026', '眠桔平', 'ねむりきっぺい', 'るぅと', '155cm', '9月18日', '乙女座', 'A型', 'アイドルユニット・Dolceのメンバー。<br>抜群の記憶力を持つが、<br>自分に自信がないのがネック。<br>「える」という名前の弟がいる。<br>実は運動神経が良い。<br><br>【登場楽曲】<br>ベビベビ・イロドレ', '21026020', '1026001'); 
INSERT INTO `character_characters` VALUES ('1027', '豆井戸宜利翔', 'まめいどぎりしゃ', 'いそろく', '175cm', '8月9日', '獅子座', 'B型', 'アイドルユニット・Dolceのメンバー。<br>明るい性格で、メンバーの盛り上げ役。<br>トレードマークのドレッドヘアーには<br>秘密がある。<br>趣味はダンスと筋トレ。<br><br>【登場楽曲】<br>ベビベビ・イロドレ', '21027020', '1027001'); 
INSERT INTO `character_characters` VALUES ('1028', 'CHiCO', 'チコ', 'CHiCO', '???', '1月27日', '水瓶座', '???', 'HoneyWorksのコラボユニット<br>「CHiCO with HoneyWorks」のボーカル。<br>ゲームとアニメとマンガと<br>美味しいものが大好き。<br><br>【登場楽曲】<br>世界は恋に落ちている・冒険のVLOG', '21028017', '1028001'); 
INSERT INTO `character_characters` VALUES ('1029', '南', 'みなみ', '豊永利行', '175cm', '2月22日', '魚座', 'O型', '桜丘高校新１年生。<br>真面目で頑張り屋だが人見知り。<br>自分を変えたくてLIP×LIPの<br>MVオーディションを受けて見事合格し、<br>タレントの道へ。<br>実はピアノが弾ける。<br><br>【登場楽曲】<br>小さなライオン・1％の恋人', '21029042', '1029001'); 
INSERT INTO `character_characters` VALUES ('1030', 'IV', 'イヴ', '福山潤', '178cm', '12月24日', '山羊座', 'A型', 'ダンスボーカルユニット・Full Throttle4の<br>マネージャー兼DJ。<br>作詞や作曲、編曲すべてを担うオールマイティな存在だが、<br>ライブのDJ以外で表に出ることはあまりない。<br>普段は優しいが、実は怒ると怖いらしい。<br><br>【登場楽曲】<br>GOOD BYE', '21030021', '1030001'); 
INSERT INTO `character_characters` VALUES ('1031', 'YUI', 'ユイ', '斉藤壮馬', '175cm', '3月4日', '魚座', 'AB型', 'ダンスボーカルユニット・Full Throttle4のメンバ－。<br>元気でノリが良いボーカリスト。<br>お調子者だが、少し気分屋という一面も持つ。<br>歳上から好かれやすい。<br><br>【登場楽曲】<br>やっぱ最強！・GOOD BYE', '21031027', '1031001'); 
INSERT INTO `character_characters` VALUES ('1032', 'RIO', 'リオ', '内田雄馬', '180cm', '10月1日', '天秤座', 'A型', 'ダンスボーカルユニット・Full Throttle4のメンバー。<br>クールで硬派なボーカリスト。<br>一歩引いて空気を読み、<br>ユニットのブレーキ的な立ち位置になることも。<br><br>【登場楽曲】<br>やっぱ最強！・GOOD BYE', '21032028', '1032001'); 
INSERT INTO `character_characters` VALUES ('1033', 'MEGU', 'メグ', '柿原徹也', '168cm', '6月12日', '双子座', 'O型', 'ダンスボーカルユニット・Full Throttle4のメンバー。<br>おしゃべりと振り付け担当のパフォーマー。<br>あざとく自由人なムードメーカーで、<br>DAIとは幼少期からの長い付き合い。<br><br>【登場楽曲】<br>やっぱ最強！・GOOD BYE', '21033021', '1033001'); 
INSERT INTO `character_characters` VALUES ('1034', 'DAI', 'ダイ', '増田俊樹', '183cm', '7月4日', '蟹座', 'B型', 'ダンスボーカルユニット・Full Throttle4のメンバー。<br>各メンバーの衣装選びも担当するパフォーマー。<br>手足が長く、スタイルの良さを活かしたパフォーマンスが得意。<br>MEGUとは幼少期からの長い付き合い。<br><br>【登場楽曲】<br>やっぱ最強！・GOOD BYE', '21034027', '1034001'); 
INSERT INTO `character_characters` VALUES ('1201', '天月-あまつき-', 'あまつき', '-', '176cm', '6月30日', '蟹座', 'A型', 'ハイトーンで少年ぽさを色濃く残した歌声は、<br>爽やかでありながらも甘い魅力があり、<br>人懐っこくいたずらっぽさを感じさせる<br>ビジュアルと併せ、多くの人々の心を掴む。', '0', '1201001'); 
INSERT INTO `character_characters` VALUES ('1997', 'クマ丸', 'くままる', '杉田智和', '???', '???', '???', '???', 'ハート型の耳がトレードマークの<br>クマの男の子。パンミィとは腐れ縁。<br>可愛い女の子には目がないが、<br>パンミィいわく「彼女ができたことがない」<br>らしい。<br><br>【登場楽曲】<br>アルティメットぷう', '21997032', '1997001'); 
INSERT INTO `character_characters` VALUES ('1998', 'パンミィ', 'ぱんみぃ', '堀江由衣', '???', '???', '???', '???', 'ハート型の耳がトレードマークの<br>パンダの女の子。クマ丸とは腐れ縁。<br>恋愛運がすこぶる悪く、散々苦労してきた。<br>趣味は占いだが、クマ丸いわく<br>ほぼ当たらない。<br><br>【登場楽曲】<br>アルティメットぷう', '21998035', '1998001'); 
